import React from 'react';
import logo from '../assets/logo.svg'

export default function Main({match}){
    return(
        <div className='main-Container'>
            <img src={logo} alt='Tindev'/>
            <ul>
                <li>
                    <img src="https://avatars0.githubusercontent.com/u/48134977?v=4" alt=""/>
                    <footer>
                        <strong>Lucas Pereira</strong>
                        <p>Amo aprender novas linguagensAtualmente programo em javascript, css, html, c#(unity).Estou estudando: Angular, React, Nodejs e C++ </p>
                    </footer>
                </li>
            </ul>
        </div>
    );
}
